/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h1>
    <h1 {...{
      "id": "csc473-project-developer-document"
    }}>{`CSC473 Project Developer Document`}</h1>
    <h1 {...{
      "id": "jobfirst"
    }}>{`JobFirst`}</h1>
    <p>{`By:
`}<strong parentName="p">{`Gong Qi Chen`}</strong>{` `}<em parentName="p">{`(product manager)`}</em>{`
`}<strong parentName="p">{`Kai Hang Chen`}</strong>{` `}<em parentName="p">{`(scrum master)`}</em>{`
`}<strong parentName="p">{`Jie Lan`}</strong>{` `}<em parentName="p">{`(developer)`}</em>{`
`}<strong parentName="p">{`Siddharth Rajan`}</strong>{` `}<em parentName="p">{`(developer)`}</em>{`
`}<strong parentName="p">{`Alan Lau`}</strong>{` `}<em parentName="p">{`(developer)`}</em></p>
    <h2 {...{
      "id": "about"
    }}>{`About:`}</h2>
    <p>{`JobFirst is a web app which utilizes `}<em parentName="p">{`Gatsby`}</em>{` to serve the frontend and `}<em parentName="p">{`AWS Amplify`}</em>{` to serve the backend. And blah blah blah....`}</p>
    <h2 {...{
      "id": "refer-here-for-our-weekly-meeting-status"
    }}><a parentName="h2" {...{
        "href": "https://github.com/Kaihchen1230/csc47300Project/wiki/Weekly-Status-Meeting-PPT"
      }}>{`Refer here for our weekly meeting status`}</a></h2>
    <hr></hr>
    <h2 {...{
      "id": "for-the-developers"
    }}>{`For the developers:`}</h2>
    <ul>
      <li parentName="ul"><strong parentName="li">{`READ FIRST`}</strong></li>
    </ul>
    <h3 {...{
      "id": "fresh-start-recommended"
    }}>{`Fresh start: (RECOMMENDED)`}</h3>
    <ol>
      <li parentName="ol">{`Delete your local`}</li>
      <li parentName="ol">{`Delete your repo`}</li>
      <li parentName="ol">{`Fork from `}<a parentName="li" {...{
          "href": "https://github.com/Kaihchen1230/csc47300Project.git"
        }}>{`Kai`}</a></li>
      <li parentName="ol"><strong parentName="li">{`(optional)`}</strong>{` On the github repo, delete the unnessascery branch such as:
A. `}<em parentName="li">{`frontend-branch`}</em>{`
B. `}<em parentName="li">{`local-branch`}</em>{` (I believe this is where Kai write his code)`}</li>
      <li parentName="ol">{`On the github repo, set `}<em parentName="li">{`newFrontend`}</em>{` as the default branch`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`git clone [your own repo link]`}</inlineCode></li>
      <li parentName="ol"><inlineCode parentName="li">{`git branch`}</inlineCode>{` you should be in `}<em parentName="li">{`newFrontend`}</em>{` branch`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`npm install`}</inlineCode>{` install the dependencies`}</li>
      <li parentName="ol"><strong parentName="li">{`(optional)`}</strong>{` `}<inlineCode parentName="li">{`amplify configure`}</inlineCode>{` create a IAM role for this project `}<strong parentName="li">{`SAVE THE ACCESS ID AND ACCESS KEY`}</strong></li>
      <li parentName="ol"><inlineCode parentName="li">{`amplify init`}</inlineCode>{` initialize the amplify backend
`}<strong parentName="li">{`USE A DIFFERENT ENV`}</strong>
        <strong parentName="li">{`USE A DIFFERENT ENV`}</strong>
        <strong parentName="li">{`USE A DIFFERENT ENV`}</strong>{`
You can name it as `}<em parentName="li">{`younameenv`}</em>{` ex: `}<em parentName="li">{`alanenv`}</em>
        <strong parentName="li">{`USE YOUR OWN PROFILE`}</strong>
        <strong parentName="li">{`USE YOUR OWN PROFILE`}</strong>{`
You can find `}<a parentName="li" {...{
          "href": "https://aws-amplify.github.io/docs/cli/init?sdk=js"
        }}>{`more information here`}</a>{` about amplify command. If you have created too many profiles you can also find the file where your profiles are being recorded and then delete 'em.`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`amplify push`}</inlineCode>{` so your backend will be in the cloud`}</li>
      <li parentName="ol">{`Begin coding...`}</li>
    </ol>
    <h3 {...{
      "id": "adding-new-amplify-service"
    }}>{`Adding new Amplify service:`}</h3>
    <ul>
      <li parentName="ul">{`In this example I will be adding an API`}</li>
    </ul>
    <ol>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`git pull`}</inlineCode>{` upstream whateverbranch we use Get the latest update from upstream. We probably use the `}<em parentName="p">{`newFrontend`}</em>{` branch. So all of our pull requeast will go to `}<em parentName="p">{`newFrontend`}</em>{`.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`npm install`}</inlineCode>{` run this after every pull from the upstream`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`amplify init`}</inlineCode>{` to sync with the backend from upstream because someone else might add something to the backend already.
`}<strong parentName="p">{`USE THE EXISTING ENV FROM PREV SECTION STEP 10`}</strong></p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`amplify push`}</inlineCode>{` now your backend should be the same front upstream and when you run `}<inlineCode parentName="p">{`gatsby develop`}</inlineCode>{` it should be working`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`amplify add api`}</inlineCode>{` to add the service that you want to add. In this case, it's api`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`amplify push`}</inlineCode>{` Set it up according your needs:
define the schema
write custom graphql
etc...`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><strong parentName="p">{`test it out to see if your backend is working`}</strong></p>
      </li>
      <li parentName="ol">
        <p parentName="li"><inlineCode parentName="p">{`git push`}</inlineCode>{` Push it to your repo to make pull request.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Create the pull request.`}</p>
      </li>
    </ol>
    <h3 {...{
      "id": "testing"
    }}>{`Testing:`}</h3>
    <p><inlineCode parentName="p">{`npm test`}</inlineCode>{` or `}<inlineCode parentName="p">{`npm test -- -- watch`}</inlineCode></p>
    <h3 {...{
      "id": "document"
    }}>{`Document:`}</h3>
    <p><inlineCode parentName="p">{`put all docs file under docs folder`}</inlineCode>{` and `}<inlineCode parentName="p">{`npm run docz:dev`}</inlineCode></p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
